window.bookSummaryJSON = "<p><b>Midlife’s a bumpy journey. The ride is a freaking roller coaster. The crisis is real.</b></p> <p>With my life back to normal - normal being a very relative word - one would think I’d catch a break.</p> <p>One would be very wrong.</p> <p>With an angel gunning for me and a demon in my bed, life couldn’t be more complicated. Not to mention, I’m going to have to make a rather large life choice.</p> <p>Do I want to live forever?</p> <p>Does anyone? Forever is a very long time.</p> <p>Whatever. I’ll think about it tomorrow...or next week...or next month. As long as I have my girlfriends, my dogs, a super-sized case of merlot, and my deceased squatters, I’m good to go.</p> <p>My midlife crisis. My rules. If it doesn’t kill me dead first, I plan to have a most excellent midlife crisis.</p>"; 
